import { useEffect } from "react";
import { useNavigate } from "react-router-dom";

function TodoPage() {
  const navigate = useNavigate();
  useEffect(() => {
    if (!localStorage.getItem("access_token")) {
      navigate("/todo");
    }
  }, []);

  return;
}

export default TodoPage;
